window.bookSummaryJSON = "<p><b>The last thing I expected from death was a second chance.</b></p> <p>I've been altered and now I'm a threat to Morningstar. If the forces working against me have their way, then I'll be dying again, and this time, they'll be no coming back.</p> <p>The clock is ticking, and I'm not sure I'll be able to get out of this situation alive.</p> <p>Hidden truths, secrets, and lies surround me.</p> <p>I hate all three.</p> <p>It's time to pull back the veil and reveal what's lurking behind it.</p> <p>Contains mature themes.</p>"; 
